import InputField from "./InputField";

const ShapeDimensionForm = ({ values }) => {
  console.log(values);

  switch (shape) {
    case circle:
      return (
        <div>
          Please specify diameter
          <InputField
            type="text"
            name="diameter"
            classes="form-input-field"
            event={events}
          />
        </div>
      );
  }

  return <h4>Shape Dimensions here</h4>;
};

export default ShapeDimensionForm;
